import React from "react";
import "./Break Length.css";

class BreakLength extends React.Component {
  render() {
    return (
      <div id="break-container">
        <h3 id="break-label">Break Length</h3>
        <div id="break-buttons">
          <button id="break-increment" onClick={this.onBreakIncrement}>
            <i class="fas fa-arrow-up"></i>
          </button>

          <h4 id="break-length">{this.state.BreakLength}</h4>
          <button id="break-decrement" onClick={this.onBreakDecrement}>
            <i class="fas fa-arrow-down"></i>
          </button>
        </div>
      </div>
    );
  }
}

export default BreakLength;
